def diff_strings(str1, str2):
    # Encontre o comprimento mínimo das duas strings
    min_len = min(len(str1), len(str2))
    
    # Inicialize uma lista para armazenar as diferenças
    diff = []
    
    # Compare os caracteres de cada string
    for i in range(min_len):
        if str1[i] != str2[i]:
            diff.append((str1[i], str2[i]))
    
    # Se as strings forem de comprimentos diferentes, adicione as diferenças de comprimento ao final da lista
    if len(str1) > len(str2):
        for i in range(min_len, len(str1)):
            diff.append((str1[i], None))
    elif len(str1) < len(str2):
        for i in range(min_len, len(str2)):
            diff.append((None, str2[i]))
    
    return diff

print(diff_strings(deles, meu))